// // "*"*2 = "**"
// Insert an element at a given position into a list.
// Example:
// scala> insertAt('new, 1, List('a, 'b, 'c, 'd))
// res0: List[Symbol] = List('a', 'new', 'b', 'c', 'd')
// kocham trzy dwukropki < ::: 3ü§ô
def insertAt(elem: Char, position: Integer, list: List[Char]): List[Char] = {
  val splitted = list.splitAt(position)
  // (splitted._1.appended(elem)).concat(splitted._2) where zadanie
  splitted._1 ::: List(elem) ::: splitted._2

}

// P28 (**) Sorting a list of lists according to length of sublists.
// a) We suppose that a list contains elements that are lists themselves. The objective is to sort the elements of the list according to their length. E.g. short lists first, longer lists later, or vice versa.
// Example:
// scala> lsort(List(List('a, 'b, 'c), List('d, 'e), List('f, 'g, 'h), List('d, 'e), List('i, 'j, 'k, 'l), List('m, 'n), List('o)))
// res0: List[List[Symbol]] = List(List('o), List('d, 'e), List('d, 'e), List('m, 'n), List('a, 'b, 'c), List('f, 'g, 'h), List('i, 'j, 'k, 'l))

def lsort(list: List[List[Int]]): List[List[Int]] = {
  list.sortBy(_.length)
}
def lsort2(list: List[List[Int]]): List[List[Int]] = {

  def len(list: List[Int]): Int = {
    @annotation.tailrec
    def go(list: List[Int], aku: Int = 0): Int = {
      list match {
        case Nil => aku
        case head :: next => go(next, aku + 1)
      }
    }
    go(list)
  }
  def quickSort(list: List[List[Int]]): List[List[Int]] = {
    list match {
      case Nil => Nil
      case head :: next =>
        val (smaller, bigger) = next.partition(len(_) < len(head))
        quickSort(smaller) ::: head :: quickSort(bigger)
    }
  }

  // def bubbleSort(list: List[List[Int]]): List[List[Int]] = {
  //   @annotation.tailrec
  //   def go(list: List[List[Int]], aku: List[List[Int]] = Nil): List[List[Int]] = {
  // _    list match {
  //       case Nil => aku
  //       case head :: next =>
  //         val (smaller, bigger) = next.partition(len(_) < len(head))
  //         go(smaller ::: bigger, aku :+ head)
  //     }
  //   }
  //   go(list)
  // }

  quickSort(list)
} // (dz | s)iury w (s | dz)ieciach?

def measureFunctionTime[A](f: => A): Unit = {
  val start = System.nanoTime()
  val result = f
  val end = System.nanoTime()
  println(s"Time: ${(end - start) / 1000000} ms")
  // result
}
